In the recent times, and currently, Iran is facing a new wave of the corona virus, witnessing spike in the number of cases and deaths. There have been pleas from the locals for helping Iran face this pandemic with better access to health care and emergency supplies.



Data description
Overview of the Covid data
The Covid-19 data for this blog post is the contribution of Our World in Data who update their GitHub repository everyday with covid data from the Johns Hopkins University Center for Systems Science and Engineering (JHU CSSE). The data is a representation of the time series data where every record is a day of the year and represents the statistics of the corona virus cases, deaths and vaccinations, both fresh and cumulative. Additional, country specific statistics are also present in the data and has 65 variables for 562 days beginning from from 2020-02-19.
Unique Values of each varibale in the data set are displayed below:
Year: 2020, 2021
Summary of Cases:
Minimum Cases: 2
Median Cases: 6285
Maximum Cases: 50228

Cases Distribution



The distribution of the reported cases and deaths is presented below, shows that unusual spike in both the cases and deaths are sparse in this country with about 200 days reporting predominantly low number of cases and deaths. The vaccinations data for Iran is not reported well with 72 percentage missing data from the date of first vaccination and 95 percent overall, and hence, this blog does not cover the vaccination roll out program in Iran.









Analysis and findings
The time series graphs below represent the number of fresh cases and deaths in Iran over the period of the recorded data from February, 2020. You can hover over the plot to see the exact number. We see that there has been rise and fall in the numbers, having five peaks separated by uniform time intervals, except in February and March of 2021 when the numbers were low. Slide across to August, 2021. The current peak in the number of positive cases and deaths has affected Iran and the country had to undergo a 6 day lockdown from the 16th of August at the time Muharram, the major religious time in Iran. We can see te lowering in the number of reported cases an deaths, however these have been increasing after lockdown ended.


